    public dynamic class func drawTarget(frame: NSRect = NSRect(x: 0, y: 0, width: 86, height: 30), original: Bool = true, pressed: Bool = false) {
        //// General Declarations
        let context = NSGraphicsContext.current()!.cgContext

        //// Color Declarations
        let white = NSColor(calibratedRed: 1, green: 1, blue: 1, alpha: 1)
        let highlightColor = NSColor(calibratedRed: 1, green: 1, blue: 1, alpha: 0.12)
        let targetBackground = NSColor(calibratedRed: 0.808, green: 0, blue: 0, alpha: 1)

        //// background
        NSGraphicsContext.saveGraphicsState()
        context.beginTransparencyLayer(auxiliaryInfo: nil)

        //// Clip mask
        let maskPath = NSBezierPath(roundedRect: NSRect(x: frame.minX, y: frame.minY + frame.height - 30, width: 86, height: 30), xRadius: 6, yRadius: 6)
        maskPath.addClip()


        //// backgroundBase Drawing
        let backgroundBasePath = NSBezierPath(rect: NSRect(x: frame.minX, y: frame.minY + frame.height - 30, width: 86, height: 30))
        targetBackground.setFill()
        backgroundBasePath.fill()


